<!doctype html>
<html lang="es">
<head>
  <meta charset="utf-8" />
  <meta name="viewport" content="width=device-width, initial-scale=1" />
  <title>Generador de firma (Distrocuyo)</title>
  <link rel="preconnect" href="https://fonts.googleapis.com">
  <link rel="preconnect" href="https://fonts.gstatic.com" crossorigin>
  <link href="https://fonts.googleapis.com/css2?family=Roboto:ital,wght@0,400;0,500;0,700;0,900;1,400&display=swap" rel="stylesheet">
  <link rel="stylesheet" href="styles.css" />
</head>
<body>
  <div id="bg"></div>

  <main class="wrap">
    <section class="panel glass">
      <h1>Generador de firma <span class="muted">(Distrocuyo)</span></h1>


      

      <div class="field">
        <label>Nombre y apellido</label>
        <input id="name" type="text" placeholder="Ej: Ricardo Darío Torre" autocomplete="name" />
      </div>

      <div class="grid2">
        <div class="field">
          <label>Cargo</label>
          <input id="role" type="text" placeholder="Ej: Diseñador gráfico" />
        </div>
        <div class="field">
          <label>Área</label>
          <input id="area" type="text" placeholder="Ej: Diseño gráfico" />
        </div>
      </div>

      <div class="phoneRow">
        <div class="field">
          <label>País</label>
          <select id="country">
            <option value="+54" selected>Argentina (+54)</option>
            <option value="+1">EE.UU. (+1)</option>
            <option value="+34">España (+34)</option>
            <option value="+55">Brasil (+55)</option>
            <option value="+56">Chile (+56)</option>
            <option value="+57">Colombia (+57)</option>
            <option value="+598">Uruguay (+598)</option>
            <option value="+51">Perú (+51)</option>
            <option value="+52">México (+52)</option>
          </select>
        </div>

        <div class="field">
          <label>Caract.</label>
          <input id="areaCode" inputmode="numeric" placeholder="261" />
        </div>

        <div class="field">
          <label>Número</label>
          <input id="number" inputmode="numeric" placeholder="5327691" />
        </div>

        <label class="check">
          <input id="mobile9" type="checkbox" checked />
          <span>móvil “9”</span>
        </label>
      </div>

      <div class="actions">
        <button id="copy" class="primary" title="Descargá la firma como PNG (1100px de ancho)">Descargá tu firma</button>
        <button id="clear" class="ghost">Borrar datos</button>
      </div>

      <p class="hint">
        *La firma se descarga como PNG a 1100px de ancho.<br>En Outlook: <em>Insertar → Imágenes</em> y elegí el archivo descargado.
      </p>
</section>

    <section class="previewWrap">
      <div class="preview glass">
        <a id="linkedinOverlay" class="linkedinOverlay" href="https://www.linkedin.com/company/distrocuyo-s.a/posts/?feedView=all" target="_blank" rel="noopener" aria-label="LinkedIn Distrocuyo"></a>
        <canvas id="c" width="2048" height="776"></canvas>
      </div>
